import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';

// Import components
import Dashboard from './components/Dashboard';
import ManageBooking from './components/ManageBooking';
import ImageManagement from './components/Portfolio/ImageManagement';
import VideoManagement from './components/Portfolio/VideoManagement';
import EventManagement from './components/Portfolio/EventManagement';
import PlaceManagement from './components/places'; // Component to handle invalid routes

const App = () => {
  return (
    <Router>
      <Routes>
        {/* Dashboard */}
        <Route path="/dashboard" element={<Dashboard />} />

        {/* Manage Booking */}
        <Route path="/managebooking" element={<ManageBooking />} />

        {/* Portfolio Management */}
        <Route path="/portfolio/image-management" element={<ImageManagement />} />
        <Route path="/portfolio/video-management" element={<VideoManagement />} />
        <Route path="/portfolio/event-management" element={<EventManagement />} />

        {/* Fallback for invalid routes */}
        <Route path="/places" element={<PlaceManagement />} />
      </Routes>
    </Router>
  );
};

export default App;
